 * Shape data for a single axis in a tensor
 */
export class TensorDim {
  bb: flatbuffers.ByteBuffer|null = null;
  bb_pos = 0;
__init(i:number, bb:flatbuffers.ByteBuffer):TensorDim {
  this.bb_pos = i;
